import React, { useState, useEffect, useRef } from "react";
import { Box, Button as GrommetButton, Grommet } from "grommet";
import "../App.css";

const Start = (EI, NS, FT, PJ, answers) => {
  const quizFinishHandler = (answers) => {
    if (EI(answers)) {
      if (NS(answers)) {
        if (FT(answers)) {
          if (PJ(answers)) {
            setStep(3);
          } else {
            setStep(4);
          }
        } else {
          if (PJ(answers)) {
            setStep(5);
          } else {
            setStep(6);
          }
        }
      } else {
        if (FT(answers)) {
          if (PJ(answers)) {
            setStep(7);
          } else {
            setStep(8);
          }
        } else {
          if (PJ(answers)) {
            setStep(9);
          } else {
            setStep(10);
          }
        }
      }
    } else {
      if (NS(answers)) {
        if (FT(answers)) {
          if (PJ(answers)) {
            setStep(11);
          } else {
            setStep(12);
          }
        } else {
          if (PJ(answers)) {
            setStep(13);
          } else {
            setStep(14);
          }
        }
      } else {
        if (FT(answers)) {
          if (PJ(answers)) {
            setStep(15);
          } else {
            setStep(16);
          }
        } else {
          if (PJ(answers)) {
            setStep(17);
          } else {
            setStep(18);
          }
        }
      }
    }
  };
  return (
    <div className="start">
      <button
        className="start_button"
        onClick={() => quizFinishHandler(answers)}
      >
        결과 확인
      </button>
    </div>
  );
};

export default Start;
